import React from 'react';
import './item-card.styles.scss';

const ItemCard=({item})=>(
    <div className='item-card'>

        <div className='image'
        style={{backgroundImage:`url(${item.imageUrl})`}}>
        </div>

        <img classname='image' src={item.imageUrl}/>
        {console.log(item.imageUrl)}

    </div>
)

export default ItemCard;
